        "SELECT\r\n\tbba.project_code c1,\r\n\tf.username c2,\r\n\tg.username c3,\r\n\te.username c4,\r\n\tbbc.molecule_type c5,\r\n\tbbd.number_of_specificities c11,\r\n\tbbd.fc_isotype c6,\r\n\tbba.cell_type c7,\r\n\tbbb.plat c8,\r\n\tbba.cloneid c9,\r\n\tbba.titer_verification titer_verification,\r\n\tbba.old_titer c10 \r\nFROM\r\n\t(\r\nSELECT\r\n\ttiter_verification,\r\n\tcreater,\r\n\tleader,\r\n\treviewer,\r\n\tproject_code,\r\n\tcell_type,\r\n\tcloneid,\r\n\ttt.old_titer \r\nFROM\r\n\t(\r\nSELECT\r\n\taa.*,\r\n\tab.project_code,\r\n\tab.cell_type,\r\n\tab.creater_userid creater,\r\n\tab.project_leader leader,\r\n\tab.project_reviewer reviewer,\r\n\t(\r\nCASE\r\n\t\r\n\tWHEN LOCATE( '-R-', aa.cell_id ) > 0 THEN\r\n\tsubstring_index( aa.cell_id, '-R-', 1 ) \r\n\tWHEN LOCATE( '-P-', aa.cell_id ) > 0 THEN\r\n\tsubstring_index( aa.cell_id, '-P-', 1 ) \r\n\tWHEN LOCATE( '-M-', aa.cell_id ) > 0 THEN\r\n\tsubstring_index( aa.cell_id, '-M-', 1 ) \r\nEND \r\n\t) cloneid \r\nFROM\r\n\t(\r\n\tSELECT\r\n\t\tsubstring_index( substring_index( a.cell_id, '||', b.ia + 1 ), '||',- 1 ) cell_id,\r\n\t\ta.titer_verification,\r\n\t\ta.create_userid,\r\n\t\ta.project_reviewer,\r\n\t\ta.project_leader,\r\n\t\ta.old_titer old_titer \r\n\tFROM\r\n\t\t( SELECT cell_id, abs( titer_verification ) titer_verification, titer_verification old_titer, create_userid, project_reviewer, project_leader FROM t_reservation_check_single_detail_result_titer WHERE stage = \"stability\" ) a\r\n\t\tJOIN ( SELECT ( @ROW := @ROW + 1 ) AS ia FROM sp_user, ( SELECT @ROW :=- 1 ) cc ) b ON b.ia < ( length( a.cell_id ) - length( REPLACE ( a.cell_id, '|', '' ) ) ) \r\n\t) aa\r\n\tLEFT JOIN (\r\n\tSELECT DISTINCT\r\n\t\tt1.sample_no,\r\n\t\tt2.creater_userid,\r\n\t\tt5.project_code,\r\n\t\tt5.cell_type,\r\n\t\tt5.project_leader,\r\n\t\tt5.project_reviewer \r\n\tFROM\r\n\t\tt_laboratory_data_detail_sample_supernatant t1\r\n\t\tINNER JOIN t_laboratory_data_detail t2 ON t1.lab_detail_id = t2.id\r\n\t\tINNER JOIN t_laboratory_data t3 ON t2.laboratory_data_id = t3.id\r\n\t\tINNER JOIN t_project_process t4 ON t3.process_id = t4.id\r\n\t\tINNER JOIN t_project_activity t5 ON t4.project_activity_id = t5.id \r\n\tWHERE\r\n\t\tt5.activity_name = \"CLD Mammalian Cell Expression\" \r\n\t\tAND t1.sample_no <> '' \r\n\t) ab ON aa.cell_id = ab.sample_no \r\nORDER BY\r\n\taa.titer_verification \r\n\tLIMIT 100000 \r\n\t) tt \r\nGROUP BY\r\n\tcloneid \r\n\t) bba\r\n\tLEFT JOIN (\r\n\tSELECT\r\n\t\tkk.project_code,\r\n\t\tGROUP_CONCAT( kk.plat SEPARATOR ',' ) AS plat \r\n\tFROM\r\n\t\t(\r\n\t\tSELECT DISTINCT\r\n\t\t\tproject_code,\r\n\t\t\t(\r\n\t\t\tCASE\r\n\t\t\t\t\t\r\n\t\t\t\t\tWHEN LOCATE( 'pwx040', c8 ) > 0 THEN\r\n\t\t\t\t\t'Wu Xia 3.0' \r\n\t\t\t\t\tWHEN LOCATE( 'pwx039', c8 ) > 0 THEN\r\n\t\t\t\t\t'Wu Xia 3.0' \r\n\t\t\t\t\tWHEN LOCATE( 'pwx138', c8 ) > 0 THEN\r\n\t\t\t\t\t'GS' \r\n\t\t\t\tEND \r\n\t\t\t\t) AS plat \r\n\t\t\tFROM\r\n\t\t\t\t( SELECT * FROM t_laboratory_data_detail WHERE template_id IN ( '518', '744', '2599' ) ) t1\r\n\t\t\t\tINNER JOIN t_laboratory_data t2 ON t1.laboratory_data_id = t2.id \r\n\t\t\tWHERE\r\n\t\t\t\tLOCATE( 'Molecule Name', c8 ) > 0 \r\n\t\t\t) kk \r\n\t\tGROUP BY\r\n\t\t\tkk.project_code \r\n\t\t) bbb ON bba.project_code = bbb.project_code\r\n\t\tLEFT JOIN (\r\n\t\tSELECT\r\n\t\t\tkk.project_code,\r\n\t\t\tGROUP_CONCAT( kk.molecule_type SEPARATOR ',' ) AS molecule_type \r\n\t\tFROM\r\n\t\t\t(\r\n\t\t\tSELECT DISTINCT\r\n\t\t\t\tmolecule_type,\r\n\t\t\t\tproject_code \r\n\t\t\tFROM\r\n\t\t\t\tc_laboratory_molecule UNION\r\n\t\t\tSELECT DISTINCT\r\n\t\t\t\tk1.molecule_type,\r\n\t\t\t\tk3.project_code \r\n\t\t\tFROM\r\n\t\t\t\tt_molecule_sequence_by_product k1\r\n\t\t\t\tINNER JOIN t_laboratory_data_detail k2 ON k1.lab_detail_id = k2.id\r\n\t\t\t\tINNER JOIN t_laboratory_data k3 ON k2.laboratory_data_id = k3.id \r\n\t\t\tWHERE\r\n\t\t\t\tk1.product LIKE CONCAT( '%', k3.project_code, '%' ) \r\n\t\t\t) kk \r\n\t\tGROUP BY\r\n\t\t\tproject_code \r\n\t\t) bbc ON bba.project_code = bbc.project_code\r\n\t\tLEFT JOIN (\r\n\t\tSELECT DISTINCT\r\n\t\t\tl1.fc_isotype,\r\n\t\t\tl2.project_code,\r\n\t\t\tl2.number_of_specificities\r\n\t\tFROM\r\n\t\t\tt_molecule_sequence_analysis l1\r\n\t\t\tLEFT JOIN c_laboratory_molecule l2 ON l1.lab_detail_id = l2.id \r\n\t\tWHERE\r\n\t\t\tl1.fc_isotype <> 'null' \r\n\t\t) bbd ON bba.project_code = bbd.project_code\r\n\t\tLEFT JOIN sp_user e ON bba.creater = e.id\r\n\tLEFT JOIN sp_user f ON bba.leader = f.accountname\r\nLEFT JOIN sp_user g ON bba.reviewer = g.accountname",
